const Login = () => {
    const [viewPdw, setViewPdw] = useState('password')
    return(
        <article className="col-12 col-sm-12 col-lg-6 col-xl-6 m-auto bg-dark">
            <form id='frm-login'>
                <input type='text' name='user'/>
                <input type={switchPdw} name='pdw'/>
                <input type='submit' value='Ingresar'/>
            </form>
        </article>
    )
}

export default Login;
